import React from 'react';
import logo from './logo.svg';
import './App.css';

var pageName = ['Main Page','First Page','Second Page'];
var statePage = 2;

function App() 
{  
  var pageName = ['Main Page','First Page','Second Page'];
  statePage = 0;

  return (
    <div className="App">

      <div className="Page-Header">
        <div> {pageName[statePage]}</div>
      </div>

      <button>
        <div> {pageName[0]} </div>
      </button>

      <button>
        <div> {pageName[1]} </div>
      </button>

      <button>
        <div> {pageName[2]} </div>
      </button>

    </div>
  );

  function LasersActivate(e) 
  {
    e.preventDefault();
    console.log('You clicked submit.');
  }
}

export default App;
